import Avatar from "@mui/material/Avatar";
import Img from "../../assets/images/NCT_제노.PNG";

const ChartBoy = (props) => {
  const rankBoy = ["NCT 제노", "NCT 제노", "NCT 제노"];

  return (
    <div>
      <div id="chart-container">
        <div id="rank-1-idol">
          <p>1. </p>
          <Avatar
            id="rank-1-image"
            src={Img}
            sx={{ width: "4rem", height: "4rem" }}
          />
          <p>{rankBoy[0]}</p>
        </div>
        <div id="rank-23-idol">
          <div id="rank-2-idol">
            <p>2. </p>
            <Avatar className="rank-23-image" src={Img} />
            <p>{rankBoy[1]}</p>
          </div>
          <div id="rank-3-idol">
            <p>3. </p>
            <Avatar className="rank-23-image" src={Img} />
            <p>{rankBoy[2]}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ChartBoy;
